const addNewExpense = (props) => {
  const [addButton, setAddButton] = useState(false);

  const addNewHandler = () => {
    if (addButton === false) {
      setAddButton(true);
    } else {
      setAddButton(false);
    }
  };
  if (props.toggle === false) {
    return (
      <div>
        <button onClick={props.onAddNew}>Add New Expense</button>
      </div>
    );
  }
};
